import React, { useState, useContext, useEffect, useRef } from "react";
import SignUp from "../../assets/images/signUp.png";
import Input from "../../globalComponents/Input";
import Container from "../../globalComponents/Container";
import {GenerateMistake} from "../../globalComponents/GenerateMistake"
const CreateSignUpScreen=()=>{
	const errors=useState({
		fullName:false,
		password:false,
		email:false
	})
	return (<Container>
		<img className="screen__image" src={SignUp}/>
		<p className="screen-margin title">Create a user to have an access to library</p>
		<div className="width">
			<p className="blackTitle">Full name</p>
			<Input/>
			{errors.fullName && <div></div>}
		</div>
	</Container>);
}
export default CreateSignUpScreen;
